            node_id: 'MDQ6VXNlcjE2OTc1MDU5',
            avatar_url: 'https://avatars.githubusercontent.com/u/16975059?v=4',
            gravatar_id: '',
            url: 'https://api.github.com/users/ku8ar',
            html_url: 'https://github.com/ku8ar',
            followers_url: 'https://api.github.com/users/ku8ar/followers',
            following_url:
                'https://api.github.com/users/ku8ar/following{/other_user}',
            gists_url: 'https://api.github.com/users/ku8ar/gists{/gist_id}',
            starred_url:
                'https://api.github.com/users/ku8ar/starred{/owner}{/repo}',
            subscriptions_url:
                'https://api.github.com/users/ku8ar/subscriptions',
