        title: 'Remove _xall, _xany, _xfind(Last)?(Index)?',
        user: {
            login: 'wojpawlik',
            id: 23058303,
            node_id: 'MDQ6VXNlcjIzMDU4MzAz',
            avatar_url: 'https://avatars.githubusercontent.com/u/23058303?v=4',
            gravatar_id: '',
            url: 'https://api.github.com/users/wojpawlik',
            html_url: 'https://github.com/wojpawlik',
            followers_url: 'https://api.github.com/users/wojpawlik/followers',
            following_url:
                'https://api.github.com/users/wojpawlik/following{/other_user}',
            gists_url: 'https://api.github.com/users/wojpawlik/gists{/gist_id}',
            starred_url:
                'https://api.github.com/users/wojpawlik/starred{/owner}{/repo}',
            subscriptions_url:
                'https://api.github.com/users/wojpawlik/subscriptions',
            organizations_url: 'https://api.github.com/users/wojpawlik/orgs',
            repos_url: 'https://api.github.com/users/wojpawlik/repos',
            events_url:
                'https://api.github.com/users/wojpawlik/events{/privacy}',
            received_events_url:
                'https://api.github.com/users/wojpawlik/received_events',
            type: 'User',
            site_admin: false,
        },
        body: "Transducers are useful for transforming a sequence into another sequence.\r\n\r\nThese are not that. These are about reducing a sequence to a single value.\r\n\r\nThey break `anyFunction(anyArray) === into([], anyFunction, anyArray)`, which causes [confusion](https://github.com/ramda/ramda/pull/2689#issuecomment-435619988) and [special casing](https://github.com/ramda/ramda/pull/2585/commits/cda6f0b356a6150cf680447292a0e3ee94b7e057).\r\n\r\nWhat are they useful for, anyway?\r\n\r\nThe only use-case I can think about is using them with something like [Highland](https://highlandjs.org/#transduce), in which indexes don't make sense. It also defines its own [`find`](https://highlandjs.org/#find) that Ramda can dispatch to.",
        created_at: '2019-01-06T17:47:11Z',
        updated_at: '2019-01-06T17:47:11Z',
        closed_at: null,
        merged_at: null,
