            avatar_url: 'https://avatars.githubusercontent.com/u/719519?v=4',
            gravatar_id: '',
            url: 'https://api.github.com/users/kedashoe',
            html_url: 'https://github.com/kedashoe',
            followers_url: 'https://api.github.com/users/kedashoe/followers',
            following_url:
                'https://api.github.com/users/kedashoe/following{/other_user}',
            gists_url: 'https://api.github.com/users/kedashoe/gists{/gist_id}',
            starred_url:
                'https://api.github.com/users/kedashoe/starred{/owner}{/repo}',
            subscriptions_url:
                'https://api.github.com/users/kedashoe/subscriptions',
